import "./App.css";
import React from "react";
import NavBar from "./components/navbar";
import About from "./components/about";

function App() {
  return (
    <React.Fragment>
      <NavBar />
      //
      <main className="container-fluid bg-dark text-white vh-100 d-flex align-items-center">
        <About />
      </main>
    </React.Fragment>
  );
}

export default App;
